import app from '../firebase'
import Header from './Header/Header'
import './Home.scss'

function Home() {
  return (
    <>
      <Header />
      <h1></h1>
      <button onClick={() => app.auth().signOut()}>Sign out</button>
    </>
  )
}

export default Home
